import React  from 'react';
import  Form  from './components/Form';
import Search from './components/Search';

function App() {
  return (
    <main className="app">
      <Form />
      <Suspense fallback={<h1>Loading profile...</h1>}>

      <Search/>

      </Suspense>

    </main>
  );
}

export default App;
